    \u0275\u0275elementStart(163, "ul", 58)(164, "li", 18)(165, "strong");
    \u0275\u0275text(166, "\uBE60\uB978 \uAC1C\uBC1C \uC18D\uB3C4:");
    \u0275\u0275elementEnd();
    \u0275\u0275text(167, " \uBE60\uB974\uBA74 \uD558\uB8E8\uC5D0 \uD558\uB098\uC529 \uC0C8\uB85C\uC6B4 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uC644\uC131\uD560 \uC218 \uC788\uC5B4 \uC2DC\uC7A5 \uCD9C\uC2DC \uAE30\uAC04\uC744 \uD68D\uAE30\uC801\uC73C\uB85C \uB2E8\uCD95\uD569\uB2C8\uB2E4.");
