    \u0275\u0275elementStart(168, "ul", 59)(169, "li", 18)(170, "strong");
    \u0275\u0275text(171, "\uB192\uC740 \uD655\uC7A5\uC131:");
    \u0275\u0275elementEnd();
    \u0275\u0275text(172, " \uB2E4\uC591\uD55C \uBAA8\uB4C8\uC744 \uC870\uD569\uD558\uC5EC \uC0AC\uC6A9\uC790\uC758 \uC694\uAD6C\uC5D0 \uB9DE\uB294 \uB9DE\uCDA4\uD615 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uC27D\uAC8C \uAC1C\uBC1C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.");
