    \u0275\u0275text(177, " \uBCF5\uC7A1\uD55C \uCF54\uB529 \uAE30\uC220 \uC5C6\uC774\uB3C4 \uC544\uC774\uB514\uC5B4\uB9CC \uC788\uB2E4\uBA74 \uB204\uAD6C\uB098 \uC27D\uAC8C \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uAC1C\uBC1C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.");
