    \u0275\u0275elementStart(184, "ul", 64)(185, "li", 18)(186, "strong");
    \u0275\u0275text(187, "\uC790\uB3D9 \uCF58\uD150\uCE20 \uC0DD\uC131:");
    \u0275\u0275elementEnd();
