    \u0275\u0275elementEnd();
    \u0275\u0275text(193, " \uC0AC\uC6A9\uC790\uC758 \uC694\uAD6C\uC5D0 \uB9DE\uCDB0 \uD2B9\uC815 \uC2A4\uD0C0\uC77C\uC774\uB098 \uC8FC\uC81C\uC758 \uCF58\uD150\uCE20\uB97C \uC0DD\uC131\uD558\uB3C4\uB85D AI\uB97C \uC124\uC815\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC791\uAC00\uB4E4\uC740 \uC774\uB97C \uD1B5\uD574 \uB3C5\uC790\uB4E4\uC758 \uCDE8\uD5A5\uC5D0 \uB9DE\uB294 \uCF58\uD150\uCE20\uB97C \uD6A8\uACFC\uC801\uC73C\uB85C \uC81C\uC791\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.");
