    \u0275\u0275elementStart(228, "div", 9)(229, "p", 77);
    \u0275\u0275text(230, "AI \uB85C\uBD07 \uAE30\uBC18 \uC0DD\uC0B0 \uC2DC\uC2A4\uD15C\uC758 \uBBF8\uB798: \uB370\uC774\uD130 \uBC0F \uC2DC\uAC01\uD654 \uC911\uC2EC\uC758 \uC2A4\uB9C8\uD2B8 \uD329\uD1A0\uB9AC \uAD6C\uCD95 ");
