    \u0275\u0275elementStart(231, "p", 78);
    \u0275\u0275text(232, "\uC778\uACF5\uC9C0\uB2A5(AI)\uC758 \uAE09\uC18D\uD55C \uBC1C\uC804\uC740 \uB85C\uBD07\uC744 \uC0DD\uC0B0\uC758 \uC8FC\uC694 \uC218\uB2E8\uC73C\uB85C \uD65C\uC6A9\uD558\uB294 \uC2DC\uB300\uB97C \uC55E\uB2F9\uAE30\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC774\uB7EC\uD55C \uBCC0\uD654\uB294 \uB2E8\uC21C\uD788 \uB85C\uBD07\uC774 \uC778\uAC04 \uB178\uB3D9\uB825\uC744 \uB300\uCCB4\uD558\uB294 \uAC83 \uC774\uC0C1\uC758 \uC758\uBBF8\uB97C \uC9C0\uB2D9\uB2C8\uB2E4. AI \uB85C\uBD07\uC740 \uC0DD\uC0B0 \uACFC\uC815 \uC804\uCCB4\uB97C \uB370\uC774\uD130 \uBC0F \uC2DC\uAC01\uD654 \uAE30\uBC18\uC73C\uB85C \uC7AC\uAD6C\uC131\uD558\uC5EC \uC2A4\uB9C8\uD2B8 \uD329\uD1A0\uB9AC \uAD6C\uCD95\uC744 \uAC00\uC18D\uD654\uD560 \uAC83\uC785\uB2C8\uB2E4.");
