    \u0275\u0275text(278, "\uB514\uC2A4\uD2B8\uB9AD\uD2B8(d'strict)\uB294 \uD601\uC2E0\uC801\uC778 \uD504\uB85C\uC81D\uD2B8 \uC9C4\uD589 \uC911 \uBC1C\uC0DD\uD558\uB294 \uAE30\uC220\uC801 \uB09C\uAD00 \uD574\uACB0\uC744 \uC704\uD574 \uC800\uC5D0\uAC8C \uC790\uBB38\uC744 \uC694\uCCAD\uD558\uACE4 \uD588\uC2B5\uB2C8\uB2E4. \uD2B9\uD788 \uAE30\uC5B5\uC5D0 \uB0A8\uB294 \uC0AC\uB840\uB294 \uD574\uC678 \uACE0\uAC1D\uC0AC\uC758 \uB300\uADDC\uBAA8 \uC778\uD130\uB799\uD2F0\uBE0C \uC804\uC2DC \uC2DC\uC2A4\uD15C\uC5D0\uC11C \uBC1C\uC0DD\uD55C \uD37C\uD3EC\uBA3C\uC2A4 \uC774\uC288\uC600\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(279, "p", 102);
    \u0275\u0275text(280, "\uD604\uC7A5\uC5D0\uC11C \uC0AC\uC6A9\uC790 \uC99D\uAC00\uC5D0 \uB530\uB77C \uC2DC\uC2A4\uD15C \uD504\uB9AC\uC9D5 \uD604\uC0C1\uC774 \uBCF4\uACE0\uB418\uC5C8\uC9C0\uB9CC, \uD574\uC678 \uC804\uC2DC\uB77C\uB294 \uD2B9\uC218\uD55C \uC0C1\uD669\uC73C\uB85C \uC778\uD574 \uC9C1\uC811\uC801\uC778 \uB514\uBC84\uAE45\uC774 \uBD88\uAC00\uB2A5\uD588\uC2B5\uB2C8\uB2E4. \uC774\uC5D0 \uC800\uB294 \uC6D0\uACA9\uC73C\uB85C \uBB38\uC81C \uD574\uACB0\uC5D0 \uCC29\uC218\uD588\uC2B5\uB2C8\uB2E4. \uC6B0\uC120 \uC2DC\uC2A4\uD15C \uBD80\uD558 \uD14C\uC2A4\uD2B8 \uD658\uACBD\uC744 \uAD6C\uCD95\uD558\uC5EC \uC2E4\uC81C \uC6B4\uC601 \uD658\uACBD\uACFC \uC720\uC0AC\uD55C \uC0C1\uD669\uC744 \uC2DC\uBBAC\uB808\uC774\uC158\uD558\uACE0, \uBA54\uBAA8\uB9AC \uD504\uB85C\uD30C\uC77C\uB9C1 \uD234\uC744 \uD65C\uC6A9\uD558\uC5EC \uBA54\uBAA8\uB9AC \uB204\uC218 \uBC1C\uC0DD \uC9C0\uC810\uC744 \uCD94\uC801\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(281, "p", 103);
    \u0275\u0275text(282, "\uC2EC\uCE35 \uBD84\uC11D \uACB0\uACFC, WPF(PixelSense) \uD504\uB808\uC784\uC6CC\uD06C \uAE30\uBC18 UI \uB808\uC774\uC544\uC6C3\uC5D0\uC11C \uC911\uCCA9 Grid \uC0AC\uC6A9\uC73C\uB85C \uC778\uD55C \uC774\uBCA4\uD2B8 \uBC84\uBE14\uB9C1\uC774 \uACFC\uB3C4\uD55C \uBA54\uBAA8\uB9AC \uC0AC\uC6A9\uC744 \uC57C\uAE30\uD558\uACE0 \uC788\uC74C\uC744 \uBC1C\uACAC\uD588\uC2B5\uB2C8\uB2E4. \uC774\uC5D0 \uC774\uBCA4\uD2B8 \uD578\uB4E4\uB7EC \uCD5C\uC801\uD654 \uBC0F \uBA54\uBAA8\uB9AC \uAD00\uB9AC \uC804\uB7B5 \uAC1C\uC120\uC744 \uD1B5\uD574 \uBB38\uC81C\uB97C \uD574\uACB0\uD558\uACE0, \uC6D0\uACA9 \uD328\uCE58\uB97C \uD1B5\uD574 \uC2DC\uC2A4\uD15C \uC548\uC815\uC131\uC744 \uD655\uBCF4\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(283, "p", 104);
    \u0275\u0275text(284, "\uC774\uB7EC\uD55C \uACBD\uD5D8\uC744 \uD1B5\uD574 \uC800\uB294 ");
    \u0275\u0275elementStart(285, "strong");
    \u0275\u0275text(286, "\uC6D0\uACA9 \uD658\uACBD\uC5D0\uC11C\uC758 \uBB38\uC81C \uD574\uACB0 \uB2A5\uB825");
    \u0275\u0275elementEnd();
    \u0275\u0275text(287, "\uACFC ");
    \u0275\u0275elementStart(288, "strong");
    \u0275\u0275text(289, "\uBCF5\uC7A1\uD55C \uC2DC\uC2A4\uD15C \uC544\uD0A4\uD14D\uCC98\uC5D0 \uB300\uD55C \uAE4A\uC774 \uC788\uB294 \uC774\uD574");
    \u0275\u0275elementEnd();
    \u0275\u0275text(290, "\uB97C \uBC14\uD0D5\uC73C\uB85C \uC2E4\uC9C8\uC801\uC778 \uC194\uB8E8\uC158\uC744 \uC81C\uACF5\uD558\uB294 \uC804\uBB38\uC131\uC744 \uC785\uC99D\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275element(291, "p", 105)(292, "p", 106);
    \u0275\u0275elementStart(293, "figure", 107)(294, "div", 7)(295, "span", 8);
    \u0275\u0275text(296, "\u{1F4A1}");
    \u0275\u0275elementEnd()();
    \u0275\u0275elementStart(297, "div", 9);
    \u0275\u0275text(298, "\uC2E4\uC2DC\uAC04 \uC5B5\uB2E8\uC704 \uBE45\uB370\uC774\uD130 \uBCD1\uB82C/\uBD84\uC0B0 \uCC98\uB9AC \uBC0F Virtual Gantt Chart \uAC1C\uBC1C (\uC90C/\uD39C)");
    \u0275\u0275elementEnd()();
    \u0275\u0275element(299, "p", 108);
    \u0275\u0275elementStart(300, "p", 109);
    \u0275\u0275text(301, "\uC0BC\uC131 \uB514\uC2A4\uD50C\uB808\uC774\uC758 \uACE0\uB3C4\uD654\uB41C \uC790\uB3D9\uD654 \uC0DD\uC0B0 \uB77C\uC778\uC740 \uB192\uC740 \uC0DD\uC0B0\uC131\uC744 \uC790\uB791\uD588\uC9C0\uB9CC, \uC218\uB9CE\uC740 \uC9C0\uC5F0 \uC694\uC18C\uB85C \uC778\uD574 \uBCD1\uBAA9 \uD604\uC0C1 \uBD84\uC11D\uC5D0 \uC5B4\uB824\uC6C0\uC744 \uACAA\uACE0 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uC774\uB97C \uD574\uACB0\uD558\uAE30 \uC704\uD574 \uBAA8\uB4E0 \uACF5\uC815 \uC694\uC18C\uC5D0 \uC13C\uC11C\uB97C \uC801\uC6A9\uD558\uC5EC \uC2E4\uC2DC\uAC04 \uB370\uC774\uD130\uB97C \uC218\uC9D1\uD558\uB294 \uC2DC\uC2A4\uD15C\uC774 \uD544\uC694\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(302, "p", 110);
    \u0275\u0275text(303, "\uAE30\uC874 SDS\uC758 E-MAS \uC2DC\uC2A4\uD15C\uC740 \uBE45\uB370\uC774\uD130 \uBD84\uC11D\uC5D0 20\uBD84 \uC774\uC0C1 \uC18C\uC694\uB418\uACE0 \uC7A6\uC740 \uBA54\uBAA8\uB9AC \uBD80\uC871 \uC624\uB958\uB85C \uC778\uD574 \uC2E4\uC2DC\uAC04 \uBD84\uC11D\uC774 \uBD88\uAC00\uB2A5\uD588\uC2B5\uB2C8\uB2E4. \uC774\uC5D0 \uC800\uB294 \uB300\uADDC\uBAA8 \uB370\uC774\uD130 \uCC98\uB9AC \uC131\uB2A5\uC744 \uD68D\uAE30\uC801\uC73C\uB85C \uD5A5\uC0C1\uC2DC\uD0A8 E-MAS2 \uC2DC\uC2A4\uD15C \uAC1C\uBC1C\uC744 \uC8FC\uB3C4\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(304, "p", 111);
    \u0275\u0275text(305, "E-MAS2\uB294 \uCD08\uB2F9 1\uC5B5 \uAC1C \uC774\uC0C1\uC758 \uC2E4\uC2DC\uAC04 \uB370\uC774\uD130 \uC2A4\uD2B8\uB9BC\uC744 \uCC98\uB9AC\uD558\uAE30 \uC704\uD574 \uBD84\uC0B0 \uCEF4\uD4E8\uD305 \uC544\uD0A4\uD14D\uCC98\uB97C \uB3C4\uC785\uD558\uACE0, \uB370\uC774\uD130 \uBCD1\uB82C \uCC98\uB9AC \uAE30\uC220\uC744 \uC801\uC6A9\uD588\uC2B5\uB2C8\uB2E4. \uB610\uD55C, \uBAA8\uB4E0 \uB370\uC774\uD130\uB97C \uCC28\uD2B8\uC5D0 \uC9C1\uC811 \uBC14\uC778\uB529\uD558\uB294 \uB300\uC2E0, \uC90C/\uD32C \uAE30\uB2A5\uACFC \uC801\uBD84 \uAE30\uBC18 \uB370\uC774\uD130 \uC9D1\uACC4 \uAE30\uB2A5\uC744 \uAC16\uCD98 Virtual Gantt Chart\uB97C \uAC1C\uBC1C\uD558\uC5EC \uC2DC\uAC01\uC801\uC778 \uBD84\uC11D \uD6A8\uC728\uC131\uC744 \uADF9\uB300\uD654\uD588\uC2B5\uB2C8\uB2E4. \uC774\uB97C \uD1B5\uD574 \uC0AC\uC6A9\uC790\uB294 \uBC29\uB300\uD55C \uB370\uC774\uD130\uB97C \uC9C1\uAD00\uC801\uC73C\uB85C \uD30C\uC545\uD558\uACE0, \uC138\uBD80 \uBD84\uC11D\uC774 \uD544\uC694\uD55C \uC601\uC5ED\uC744 \uC2E0\uC18D\uD558\uAC8C \uC2DD\uBCC4\uD560 \uC218 \uC788\uAC8C \uB418\uC5C8\uC2B5\uB2C8\uB2E4. ");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(306, "p", 112);
    \u0275\u0275text(307, "E-MAS2 \uAC1C\uBC1C\uC740 \uBE45\uB370\uC774\uD130 \uCC98\uB9AC, \uC2E4\uC2DC\uAC04 \uBD84\uC11D, UI/UX \uCD5C\uC801\uD654 \uB4F1 \uB2E4\uC591\uD55C \uAE30\uC220\uC801 \uACFC\uC81C\uB97C \uD574\uACB0\uD574\uC57C \uD558\uB294 \uB3C4\uC804\uC801\uC778 \uD504\uB85C\uC81D\uD2B8\uC600\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC800\uB294 \uB04A\uC784\uC5C6\uB294 \uC5F0\uAD6C\uC640 \uD601\uC2E0\uC744 \uD1B5\uD574 \uC2DC\uC2A4\uD15C\uC744 \uC131\uACF5\uC801\uC73C\uB85C \uAD6C\uCD95\uD588\uACE0, \uC0BC\uC131 \uB514\uC2A4\uD50C\uB808\uC774\uC758 \uC0DD\uC0B0 \uD6A8\uC728\uC131 \uD5A5\uC0C1\uC5D0 \uAE30\uC5EC\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275element(308, "p", 113);
    \u0275\u0275elementStart(309, "figure", 114);
    \u0275\u0275element(310, "img", 115);
    \u0275\u0275elementEnd();
    \u0275\u0275element(311, "p", 116);
    \u0275\u0275elementStart(312, "figure", 117)(313, "div", 7)(314, "span", 8);
    \u0275\u0275text(315, "\u{1F4A1}");
    \u0275\u0275elementEnd()();
    \u0275\u0275elementStart(316, "div", 9);
    \u0275\u0275text(317, "\uD074\uB77C\uC6B0\uB4DC \uAE30\uBC18 \uBCD1\uC6D0 \uC758\uB8CC \uC815\uBCF4 \uC2DC\uC2A4\uD15C\uC758 Rule Engine (Logic Flow) \uAC1C\uBC1C ");
    \u0275\u0275elementEnd()();
    \u0275\u0275element(318, "p", 118);
    \u0275\u0275elementStart(319, "p", 119);
    \u0275\u0275text(320, "\uC11C\uC6B8\uB300\uD559\uAD50\uBCD1\uC6D0 \uCC28\uC138\uB300 \uBCD1\uC6D0\uC815\uBCF4\uC2DC\uC2A4\uD15C(C-HIS) \uAC1C\uBC1C \uD504\uB85C\uC81D\uD2B8\uC5D0 \uAE30\uC220 \uC790\uBB38(Technical Assistance)\uC73C\uB85C \uCC38\uC5EC\uD558\uBA74\uC11C, \uBCF5\uC7A1\uD55C \uD658\uC790\uBCC4 \uBCF4\uD5D8 \uC801\uC6A9 \uB85C\uC9C1 \uAD00\uB9AC \uBB38\uC81C\uB97C \uD574\uACB0\uD588\uC2B5\uB2C8\uB2E4. \uAE30\uC874 \uC2DC\uC2A4\uD15C\uC740 \uAC74\uAC15\uBCF4\uD5D8\uC2EC\uC0AC\uD3C9\uAC00\uC6D0\uC758 \uADDC\uC815 \uBCC0\uACBD \uC2DC\uB9C8\uB2E4 \uAC1C\uBC1C\uC790\uAC00 \uC18C\uC2A4 \uCF54\uB4DC\uB97C \uC218\uC815\uD558\uACE0 \uC7AC\uBC30\uD3EC\uD574\uC57C \uD558\uB294 \uBE44\uD6A8\uC728\uC801\uC778 \uAD6C\uC870\uC600\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(321, "p", 120);
    \u0275\u0275text(322, "\uC774\uB7EC\uD55C \uBB38\uC81C\uB97C \uD574\uACB0\uD558\uAE30 \uC704\uD574 \uC800\uB294 \uC5B8\uB9AC\uC5BC \uC5D4\uC9C4\uC758 \uBE14\uB8E8\uD504\uB9B0\uD2B8 \uC2DC\uC2A4\uD15C\uC5D0\uC11C \uC601\uAC10\uC744 \uC5BB\uC5B4 \uC2DC\uAC01\uC801\uC778 \uB8F0 \uC5D4\uC9C4\uC744 \uAC1C\uBC1C\uD588\uC2B5\uB2C8\uB2E4. \uC77C\uB809\uD2B8\uB860(Electron) \uD504\uB808\uC784\uC6CC\uD06C\uB97C \uAE30\uBC18\uC73C\uB85C \uAD6C\uCD95\uB41C \uC774 \uB8F0 \uC5D4\uC9C4\uC740 \uC708\uB3C4\uC6B0, macOS \uB4F1 \uB2E4\uC591\uD55C \uC6B4\uC601\uCCB4\uC81C \uD658\uACBD\uC5D0\uC11C \uC0AC\uC6A9 \uAC00\uB2A5\uD558\uBA70, \uC9C1\uAD00\uC801\uC778 \uB178\uB4DC \uAE30\uBC18 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uD1B5\uD574 \uBCF4\uD5D8 \uC804\uBB38\uAC00\uAC00 \uC9C1\uC811 \uBCF5\uC7A1\uD55C \uBCF4\uD5D8 \uB85C\uC9C1\uC744 \uC2DC\uAC01\uC801\uC73C\uB85C \uC124\uACC4\uD558\uACE0 \uAD00\uB9AC\uD560 \uC218 \uC788\uB3C4\uB85D \uC9C0\uC6D0\uD569\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(323, "p", 121);
    \u0275\u0275text(324, "\uBCF4\uD5D8 \uB8F0 \uC5D4\uC9C4 \uB3C4\uC785\uC744 \uD1B5\uD574 \uAC1C\uBC1C\uC790\uC758 \uBD88\uD544\uC694\uD55C \uC791\uC5C5 \uBD80\uB2F4\uC744 \uC904\uC774\uACE0, \uBCF4\uD5D8 \uC804\uBB38\uAC00\uC758 \uC5C5\uBB34 \uD6A8\uC728\uC131\uC744 \uD5A5\uC0C1\uC2DC\uCF30\uC2B5\uB2C8\uB2E4. \uB610\uD55C, \uC2DC\uC2A4\uD15C \uC720\uC9C0\uBCF4\uC218 \uBC0F \uD655\uC7A5\uC131\uC744 \uB192\uC5EC \uBCD1\uC6D0\uC815\uBCF4\uC2DC\uC2A4\uD15C \uC6B4\uC601 \uC548\uC815\uC131\uC744 \uAC15\uD654\uD558\uB294 \uB370 \uAE30\uC5EC\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275element(325, "p", 122);
    \u0275\u0275elementStart(326, "figure", 123);
    \u0275\u0275element(327, "img", 124);
    \u0275\u0275elementEnd();
    \u0275\u0275element(328, "p", 125);
    \u0275\u0275elementStart(329, "figure", 126)(330, "div", 7)(331, "span", 8);
    \u0275\u0275text(332, "\u{1F4A1}");
    \u0275\u0275elementEnd()();
    \u0275\u0275elementStart(333, "div", 9);
    \u0275\u0275text(334, "\uAE00\uB85C\uBC8C\uC740\uD589 SPA \uD504\uB808\uC784\uC6CC\uD06C IOS/Android \uC801\uC6A9 ");
    \u0275\u0275elementEnd()();
    \u0275\u0275element(335, "p", 127);
    \u0275\u0275elementStart(336, "p", 128);
    \u0275\u0275text(337, "\uD55C\uAD6D \uC2DC\uD2F0\uC740\uD589 \uBAA8\uBC14\uC77C \uC571\uC740 \uAD6D\uB0B4 \uAE30\uC220 \uAE30\uBC18 \uC0DD\uCCB4 \uC778\uC99D \uBC0F \uBE44\uB300\uBA74 \uC11C\uBE44\uC2A4\uB97C \uB124\uC774\uD2F0\uBE0C \uAE30\uB2A5\uC73C\uB85C \uC81C\uACF5\uD558\uACE0 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uC774\uB85C \uC778\uD574 \uB9AC\uC804 \uD300\uC5D0\uC11C \uC8FC\uB3C4\uD558\uB294 Angular \uAE30\uBC18 Odyssey \uD504\uB808\uC784\uC6CC\uD06C\uC758 \uAE30\uC220\uC801 \uD1B5\uD569\uC5D0 \uC5B4\uB824\uC6C0\uC744 \uACAA\uACE0 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uD2B9\uD788, Odyssey \uC5D4\uC9C4\uC774 Apache Cordova\uB97C \uD1B5\uD574 \uB124\uC774\uD2F0\uBE0C \uAE30\uB2A5\uACFC \uC5F0\uB3D9\uB418\uB294 \uAD6C\uC870\uB294 \uAE30\uC874 \uC571\uC758 \uB124\uC774\uD2F0\uBE0C \uC11C\uBE44\uC2A4\uC640 \uD638\uD658\uB418\uC9C0 \uC54A\uB294 \uBB38\uC81C\uB97C \uC57C\uAE30\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(338, "p", 129);
    \u0275\u0275text(339, "2\uB144 \uC774\uC0C1 \uD574\uACB0\uB418\uC9C0 \uBABB\uD55C \uC774 \uBB38\uC81C\uB97C \uD574\uACB0\uD558\uAE30 \uC704\uD574 \uC800\uB294 Angular (Odyssey)\uC640 \uC790\uCCB4 \uAC1C\uBC1C\uD55C \uB124\uC774\uD2F0\uBE0C \uC778\uD130\uD398\uC774\uC2A4 \uAE30\uC220\uC744 \uD1B5\uD569\uD558\uB294 \uC194\uB8E8\uC158\uC744 \uC81C\uC2DC\uD588\uC2B5\uB2C8\uB2E4. \uC774 \uC194\uB8E8\uC158\uC740 \uAE30\uC874 \uC571\uC758 \uC0DD\uCCB4 \uC778\uC99D \uBC0F \uBE44\uB300\uBA74 \uC11C\uBE44\uC2A4 \uAE30\uB2A5\uC744 \uC720\uC9C0\uD558\uBA74\uC11C Odyssey \uD504\uB808\uC784\uC6CC\uD06C\uC758 \uC7A5\uC810\uC744 \uD65C\uC6A9\uD560 \uC218 \uC788\uB3C4\uB85D \uC124\uACC4\uB418\uC5C8\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(340, "p", 130);
    \u0275\u0275text(341, "\uC774\uB97C \uD1B5\uD574 \uD55C\uAD6D \uC2DC\uD2F0\uC740\uD589 \uC571\uC740 \uB9AC\uC804 \uD45C\uC900 \uD504\uB808\uC784\uC6CC\uD06C\uB97C \uC131\uACF5\uC801\uC73C\uB85C \uB3C4\uC785\uD558\uC5EC \uAC1C\uBC1C \uBC0F \uC720\uC9C0\uBCF4\uC218 \uD6A8\uC728\uC131\uC744 \uD5A5\uC0C1\uC2DC\uD0A4\uB294 \uB3D9\uC2DC\uC5D0, \uAE30\uC874 \uC0AC\uC6A9\uC790\uB4E4\uC5D0\uAC8C \uC775\uC219\uD55C \uC0AC\uC6A9\uC790 \uACBD\uD5D8\uC744 \uC81C\uACF5\uD560 \uC218 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uC774\uB294 ");
    \u0275\u0275elementStart(342, "strong");
    \u0275\u0275text(343, "\uB808\uAC70\uC2DC \uC2DC\uC2A4\uD15C\uACFC \uCD5C\uC2E0 \uAE30\uC220 \uAC04\uC758 \uD1B5\uD569");
    \u0275\u0275elementEnd();
    \u0275\u0275text(344, "\uC774\uB77C\uB294 \uBCF5\uC7A1\uD55C \uACFC\uC81C\uB97C \uD574\uACB0\uD55C \uC131\uACF5\uC801\uC778 \uC0AC\uB840\uB85C, ");
    \u0275\u0275elementStart(345, "strong");
    \u0275\u0275text(346, "\uBB38\uC81C \uD574\uACB0 \uB2A5\uB825");
