    \u0275\u0275element(363, "p", 138);
    \u0275\u0275elementStart(364, "p", 139);
    \u0275\u0275text(365, "KB\uAE08\uC735\uADF8\uB8F9 \uD1B5\uD569 \uCC57\uBD07 \uD50C\uB7AB\uD3FC \uAD6C\uCD95 \uD504\uB85C\uC81D\uD2B8(KB FCC ONE \uCC57\uBD07)\uB294 KB\uC9C0\uC8FC\uC0AC\uB4E4\uC758 \uB2E4\uC591\uD55C \uC5C5\uBB34\uB97C \uB2E8\uC77C \uCC57\uBD07 \uC2DC\uC2A4\uD15C\uC73C\uB85C \uD1B5\uD569\uD558\uB294 \uAC83\uC744 \uBAA9\uD45C\uB85C \uD588\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC 1\uB144 \uC774\uC0C1 \uC9C4\uD589\uB41C \uD504\uB85C\uC81D\uD2B8\uB294 KB\uAD6D\uBBFC\uC740\uD589 \uC571\uC758 \uAE30\uC220\uC801 \uBB38\uC81C, \uACC4\uC5F4\uC0AC \uAC04 \uC2DC\uC2A4\uD15C \uC774\uC9C8\uC131 \uB4F1\uC73C\uB85C \uC778\uD574 \uB09C\uD56D\uC744 \uACAA\uACE0 \uC788\uC5C8\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(366, "div", 140)(367, "div", 141)(368, "p", 142);
    \u0275\u0275text(369, "LG CNS\uB294 \uD504\uB85C\uC81D\uD2B8 \uC815\uC0C1\uD654\uB97C \uC704\uD574 \uC800\uC5D0\uAC8C \uAE30\uC220 \uC790\uBB38\uC744 \uC694\uCCAD\uD588\uC2B5\uB2C8\uB2E4. \uC800\uB294 1\uB144\uAC04 \uB204\uC801\uB41C Java(Maven) \uAE30\uBC18 \uB808\uAC70\uC2DC \uCF54\uB4DC\uB97C \uC804\uBA74 \uC7AC\uAC80\uD1A0\uD558\uACE0, Multi-Module \uC544\uD0A4\uD14D\uCC98\uB97C \uB3C4\uC785\uD558\uC5EC \uC2DC\uC2A4\uD15C \uBAA8\uB4C8\uD654 \uBC0F \uD655\uC7A5\uC131\uC744 \uD655\uBCF4\uD588\uC2B5\uB2C8\uB2E4. \uB610\uD55C, \uAC01 \uACC4\uC5F4\uC0AC \uC2DC\uC2A4\uD15C\uACFC\uC758 \uD6A8\uC728\uC801\uC778 \uC5F0\uB3D9\uC744 \uC704\uD574 API Gateway\uB97C \uAD6C\uCD95\uD558\uACE0 \uD45C\uC900\uD654\uB41C \uB370\uC774\uD130 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uC815\uC758\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275element(370, "p", 143);
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(371, "div", 144)(372, "figure", 145)(373, "a", 146);
    \u0275\u0275element(374, "img", 147);
    \u0275\u0275elementEnd()()()();
    \u0275\u0275elementStart(375, "p", 148);
    \u0275\u0275text(376, "\uC774\uB7EC\uD55C \uC804\uB7B5\uC801 \uC811\uADFC\uACFC \uC2E0\uC18D\uD55C \uAC1C\uBC1C \uD504\uB85C\uC138\uC2A4\uB97C \uD1B5\uD574 \uBD88\uACFC 4\uC8FC \uB9CC\uC5D0 ONE \uCC57\uBD07 \uC2DC\uC2A4\uD15C\uC744 \uC131\uACF5\uC801\uC73C\uB85C \uC7AC\uAD6C\uCD95\uD588\uC2B5\uB2C8\uB2E4. \uC0C8\uB86D\uAC8C \uAD6C\uCD95\uB41C \uC2DC\uC2A4\uD15C\uC740 \uC548\uC815\uC801\uC778 \uC11C\uBE44\uC2A4 \uC6B4\uC601\uACFC \uB192\uC740 \uC0AC\uC6A9\uC790 \uB9CC\uC871\uB3C4\uB97C \uAE30\uB85D\uD558\uBA70 KB\uAE08\uC735\uADF8\uB8F9\uC758 \uD575\uC2EC \uCC57\uBD07 \uD50C\uB7AB\uD3FC\uC73C\uB85C \uC790\uB9AC\uB9E4\uAE40\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(377, "p", 149);
    \u0275\u0275text(378, "\uC774 \uD504\uB85C\uC81D\uD2B8\uB294 ");
    \u0275\u0275elementStart(379, "strong");
    \u0275\u0275text(380, "\uB808\uAC70\uC2DC \uC2DC\uC2A4\uD15C \uAC1C\uC120");
    \u0275\u0275elementEnd();
    \u0275\u0275text(381, ", ");
    \u0275\u0275elementStart(382, "strong");
    \u0275\u0275text(383, "\uBAA8\uB4C8\uD654 \uBC0F \uD655\uC7A5\uC131 \uD655\uBCF4");
    \u0275\u0275elementEnd();
    \u0275\u0275text(384, ", ");
    \u0275\u0275elementStart(385, "strong");
    \u0275\u0275text(386, "\uC774\uAE30\uC885 \uC2DC\uC2A4\uD15C \uAC04 \uD1B5\uD569");
    \u0275\u0275elementEnd();
    \u0275\u0275text(387, " \uB4F1 \uB2E4\uC591\uD55C \uAE30\uC220\uC801 \uACFC\uC81C\uB97C \uD574\uACB0\uD574\uC57C \uD558\uB294 \uBCF5\uC7A1\uD55C \uD504\uB85C\uC81D\uD2B8\uC600\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uC800\uB294 \uD0C1\uC6D4\uD55C ");
    \u0275\u0275elementStart(388, "strong");
    \u0275\u0275text(389, "\uBB38\uC81C \uD574\uACB0 \uB2A5\uB825");
    \u0275\u0275elementEnd();
    \u0275\u0275text(390, "\uACFC ");
    \u0275\u0275elementStart(391, "strong");
    \u0275\u0275text(392, "\uC544\uD0A4\uD14D\uCC98 \uC124\uACC4 \uC5ED\uB7C9");
    \u0275\u0275elementEnd();
    \u0275\u0275text(393, "\uC744 \uBC1C\uD718\uD558\uC5EC \uD504\uB85C\uC81D\uD2B8\uB97C \uC131\uACF5\uC801\uC73C\uB85C \uC774\uB04C \uC218 \uC788\uC5C8\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275element(394, "p", 150)(395, "p", 151);
    \u0275\u0275elementStart(396, "figure", 152)(397, "div", 7)(398, "span", 8);
    \u0275\u0275text(399, "\u{1F4A1}");
    \u0275\u0275elementEnd()();
    \u0275\u0275elementStart(400, "div", 9);
    \u0275\u0275text(401, "\uC5EC\uB7EC \uB9E4\uAC70\uC9C4 (\uBAA8\uBC14\uC77C, \uB370\uC2A4\uD06C, \uD1B5\uD569 \uB9F4\uBC84\uC27D)\uC744 MVVM \uD328\uD134\uC73C\uB85C \uD55C\uBC88\uC5D0 \uC644\uC131");
    \u0275\u0275elementEnd()();
    \u0275\u0275element(402, "p", 153);
    \u0275\u0275elementStart(403, "p", 154);
    \u0275\u0275text(404, "\uAD11\uACE0 \uAE30\uBC18 \uC11C\uBE44\uC2A4 \uD50C\uB7AB\uD3FC \uAC1C\uBC1C \uC2DC, \uBC18\uC751\uD615 \uC6F9 \uAE30\uC220\uC740 \uBAA8\uBC14\uC77C \uD658\uACBD \uCD5C\uC801\uD654\uC5D0 \uC720\uB9AC\uD558\uC9C0\uB9CC \uB370\uC2A4\uD06C\uD1B1\uC758 \uB2E4\uC591\uD55C \uAD11\uACE0 \uBC30\uCE58 \uBC0F UX \uC694\uAD6C\uC0AC\uD56D\uC744 \uCDA9\uC871\uC2DC\uD0A4\uAE30 \uC5B4\uB824\uC6CC \uBCC4\uB3C4 \uAC1C\uBC1C\uC774 \uD544\uC694\uD55C \uACBD\uC6B0\uAC00 \uB9CE\uC2B5\uB2C8\uB2E4. \uD5C8\uC2A4\uD2B8\uC911\uC559\uC758 \uB2E4\uC218 \uB9E4\uAC70\uC9C4 \uC0AC\uC774\uD2B8 \uD1B5\uD569 \uAC1C\uBC1C \uD504\uB85C\uC81D\uD2B8 \uC5ED\uC2DC \uC774\uB7EC\uD55C \uBB38\uC81C\uC5D0 \uC9C1\uBA74\uD588\uC2B5\uB2C8\uB2E4. \uC9E7\uC740 \uAC1C\uBC1C \uAE30\uAC04 \uB0B4\uC5D0 4\uAC1C \uB9E4\uAC70\uC9C4\uC758 \uBAA8\uBC14\uC77C/\uB370\uC2A4\uD06C\uD1B1 \uBC84\uC804(\uCD1D 8\uAC1C \uC0AC\uC774\uD2B8)\uC744 \uAD6C\uCD95\uD558\uACE0, \uACF5\uD1B5 \uB85C\uADF8\uC778 \uBC0F OK \uCE90\uC26C\uBC31 \uC5F0\uB3D9 \uB4F1 \uBCF5\uC7A1\uD55C \uC694\uAD6C\uC0AC\uD56D\uC744 \uCDA9\uC871\uD574\uC57C \uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(405, "p", 155);
    \u0275\u0275text(406, "\uC774\uC5D0 \uC800\uB294 MVVM(Model-View-ViewModel) \uB514\uC790\uC778 \uD328\uD134\uC744 \uC801\uC6A9\uD558\uC5EC \uD6A8\uC728\uC801\uC778 \uAC1C\uBC1C \uBC0F \uAD00\uB9AC \uC804\uB7B5\uC744 \uC218\uB9BD\uD588\uC2B5\uB2C8\uB2E4. \uB2E8\uC77C ViewModel\uC744 \uD1B5\uD574 \uB2E4\uC218\uC758 View\uB97C \uAD00\uB9AC\uD558\uB294 1:N \uAD6C\uC870\uB97C \uAD6C\uD604\uD568\uC73C\uB85C\uC368 \uCF54\uB4DC \uC911\uBCF5\uC744 \uCD5C\uC18C\uD654\uD558\uACE0 \uC720\uC9C0\uBCF4\uC218 \uC6A9\uC774\uC131\uC744 \uD655\uBCF4\uD588\uC2B5\uB2C8\uB2E4. \uD2B9\uD788, WPF(Windows Presentation Foundation) \uAC1C\uBC1C \uACBD\uD5D8\uC744 \uBC14\uD0D5\uC73C\uB85C MVVM \uD328\uD134\uC5D0 \uB300\uD55C \uAE4A\uC774 \uC788\uB294 \uC774\uD574\uB97C \uD1B5\uD574 \uC6F9 \uAC1C\uBC1C \uD658\uACBD\uC5D0 \uB9DE\uAC8C \uB514\uC790\uC778 \uD328\uD134\uC744 \uC801\uC6A9\uD558\uC5EC \uC0DD\uC0B0\uC131\uC744 \uADF9\uB300\uD654\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(407, "p", 156);
    \u0275\u0275text(408, "\uC774\uB7EC\uD55C \uC811\uADFC \uBC29\uC2DD\uC740 \uC9E7\uC740 \uAC1C\uBC1C \uAE30\uAC04 \uB0B4\uC5D0 8\uAC1C \uC0AC\uC774\uD2B8\uB97C \uC548\uC815\uC801\uC73C\uB85C \uAD6C\uCD95\uD558\uACE0, \uD6A8\uC728\uC801\uC778 \uBC30\uD3EC \uBC0F \uC6B4\uC601 \uD658\uACBD\uC744 \uAD6C\uD604\uD558\uB294 \uB370 \uD06C\uAC8C \uAE30\uC5EC\uD588\uC2B5\uB2C8\uB2E4. \uD2B9\uD788, MVVM \uD328\uD134 \uC801\uC6A9\uC744 \uD1B5\uD574 \uCF54\uB4DC \uC7AC\uC0AC\uC6A9\uC131\uC744 \uB192\uC774\uACE0, \uD5A5\uD6C4 \uAE30\uB2A5 \uD655\uC7A5 \uBC0F \uBCC0\uACBD\uC5D0 \uC720\uC5F0\uD558\uAC8C \uB300\uC751\uD560 \uC218 \uC788\uB294 \uAE30\uBC18\uC744 \uB9C8\uB828\uD588\uC2B5\uB2C8\uB2E4. \uC774\uB294 ");
    \u0275\u0275elementStart(409, "strong");
    \u0275\u0275text(410, "MVVM \uB514\uC790\uC778 \uD328\uD134\uC758 \uB192\uC740 \uD65C\uC6A9\uC131");
    \u0275\u0275elementEnd();
    \u0275\u0275text(411, "\uACFC ");
    \u0275\u0275elementStart(412, "strong");
    \u0275\u0275text(413, "\uB2E4\uC591\uD55C \uAE30\uC220 \uC2A4\uD0DD\uC5D0 \uB300\uD55C \uAE4A\uC774 \uC788\uB294 \uC774\uD574");
    \u0275\u0275elementEnd();
    \u0275\u0275text(414, "\uB97C \uBC14\uD0D5\uC73C\uB85C \uBCF5\uC7A1\uD55C \uD504\uB85C\uC81D\uD2B8\uB97C \uC131\uACF5\uC801\uC73C\uB85C \uC774\uB04C\uC5B4\uB0B8 \uACBD\uD5D8\uC785\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
