    \u0275\u0275elementStart(432, "p", 166);
    \u0275\u0275text(433, "\uAE30\uC874 \uC2DC\uC2A4\uD15C\uC758 \uBCD1\uBAA9 \uAD6C\uAC04\uC744 \uBD84\uC11D\uD558\uACE0, \uBD84\uC0B0 \uCC98\uB9AC \uC544\uD0A4\uD14D\uCC98\uB97C \uB3C4\uC785\uD558\uC5EC \uC131\uB2A5\uC744 \uD68D\uAE30\uC801\uC73C\uB85C \uAC1C\uC120\uD588\uC2B5\uB2C8\uB2E4. \uB610\uD55C, \uC54C\uACE0\uB9AC\uC998 \uCD5C\uC801\uD654 \uBC0F \uB370\uC774\uD130 \uD30C\uC774\uD504\uB77C\uC778 \uC7AC\uC124\uACC4\uB97C \uD1B5\uD574 \uCC98\uB9AC \uC18D\uB3C4\uB97C \uD5A5\uC0C1\uC2DC\uD0A4\uACE0 \uACB0\uACFC\uBB3C\uC758 \uC815\uD655\uB3C4\uB97C \uB192\uC600\uC2B5\uB2C8\uB2E4.");
