    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(468, "p", 178);
    \u0275\u0275text(469, "\uBA40\uD2F0 \uD50C\uB7AB\uD3FC \uD638\uD658\uC131\uACFC \uACE0\uC131\uB2A5 \uC2DC\uAC01\uD654\uB97C \uBAA9\uD45C\uB85C TypeScript \uAE30\uBC18 \uD504\uB808\uC784\uC6CC\uD06C\uB97C \uC790\uCCB4 \uAC1C\uBC1C\uD588\uC2B5\uB2C8\uB2E4. JSP, React, Angular, Vue \uB4F1 \uB2E4\uC591\uD55C \uD504\uB860\uD2B8\uC5D4\uB4DC \uD658\uACBD\uC5D0\uC11C \uC6D0\uD65C\uD558\uAC8C \uC791\uB3D9\uD558\uB3C4\uB85D \uC124\uACC4\uD588\uC73C\uBA70, WebGL\uC744 \uD65C\uC6A9\uD558\uC5EC \uACE0\uAC1D\uC0AC\uC758 \uCD94\uC0C1\uC801\uC778 \uB514\uC790\uC778 \uC694\uAD6C\uC0AC\uD56D\uC744 \uB6F0\uC5B4\uB118\uB294 3D \uC2DC\uAC01\uD654 \uAE30\uB2A5\uC744 \uAD6C\uD604\uD588\uC2B5\uB2C8\uB2E4.");
