    \u0275\u0275element(499, "p", 186);
    \u0275\u0275elementStart(500, "p", 187);
    \u0275\u0275text(501, "\uC911\uAD6D \uAD50\uC721 \uAE30\uAD00\uC758 \uD559\uC2B5\uC6A9 \uC18C\uD504\uD2B8\uC6E8\uC5B4 \uAC1C\uBC1C \uD504\uB85C\uC81D\uD2B8\uC5D0 \uCC38\uC5EC\uD558\uC5EC, \uBCF5\uC7A1\uD55C \uB370\uC774\uD130 \uAD00\uACC4 \uC2DC\uAC01\uD654 \uBB38\uC81C\uB97C \uD574\uACB0\uD588\uC2B5\uB2C8\uB2E4. \uCD08\uAE30\uC5D0\uB294 SVG \uAE30\uBC18 2D \uC2DC\uAC01\uD654\uB97C \uC2DC\uB3C4\uD588\uC73C\uB098, \uB370\uC774\uD130 \uC911\uCCA9\uC73C\uB85C \uC778\uD574 \uC815\uBCF4 \uC804\uB2EC\uB825\uC774 \uC800\uD558\uB418\uB294 \uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(502, "p", 188);
    \u0275\u0275text(503, "\uC774\uC5D0 3\uCC28\uC6D0 \uC2DC\uAC01\uD654\uB97C \uD1B5\uD574 \uAC00\uC2DC\uC131\uC744 \uB192\uC774\uB294 \uBC29\uC548\uC744 \uC81C\uC548\uD588\uC2B5\uB2C8\uB2E4. \uAE30\uC874 2D SVG \uACB0\uACFC\uBB3C\uC5D0 \uC720\uD074\uB9AC\uB4DC \uAE30\uD558\uD559\uC744 \uC811\uBAA9\uD558\uACE0, 3\uCC28\uC6D0 \uD68C\uC804 \uD589\uB82C \uBC0F \uD22C\uC601 \uBCC0\uD658 \uC218\uC2DD\uC744 \uC801\uC6A9\uD558\uC5EC \uB370\uC774\uD130\uB97C 3\uCC28\uC6D0 \uACF5\uAC04\uC5D0 \uBC30\uCE58\uD588\uC2B5\uB2C8\uB2E4. \uC774\uB97C \uD1B5\uD574 \uC0AC\uC6A9\uC790\uB294 \uB2E4\uC591\uD55C \uAC01\uB3C4\uC5D0\uC11C \uB370\uC774\uD130\uB97C \uAD00\uCC30\uD558\uACE0, \uBCF5\uC7A1\uD55C \uAD00\uACC4\uB97C \uC9C1\uAD00\uC801\uC73C\uB85C \uD30C\uC545\uD560 \uC218 \uC788\uAC8C \uB418\uC5C8\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(504, "p", 189);
    \u0275\u0275text(505, " \uD504\uB85C\uC81D\uD2B8 \uC218\uD589 \uACFC\uC815\uC5D0\uC11C 3\uCC28\uC6D0 \uAE30\uD558\uD559 \uBC0F \uCEF4\uD4E8\uD130 \uADF8\uB798\uD53D\uC2A4 \uAE30\uC220\uC5D0 \uB300\uD55C \uAE4A\uC774 \uC788\uB294 \uC774\uD574\uB97C \uC5BB\uC744 \uC218 \uC788\uC5C8\uC2B5\uB2C8\uB2E4.");
