    \u0275\u0275elementStart(525, "p", 197);
    \u0275\u0275text(526, "\uAC1C\uBC1C\uC790\uB85C\uC11C\uC758 \uCEE4\uB9AC\uC5B4\uB97C \uC313\uC544\uAC00\uB294 \uB3D9\uC548, \uD601\uC2E0\uC801\uC778 \uB178\uCF54\uB4DC \uD50C\uB7AB\uD3FC \uAC1C\uBC1C\uC744 \uD1B5\uD574 \uCC3D\uC5C5\uC758 \uAFC8\uC744 \uC2E4\uD604\uD558\uACE0\uC790 \uD588\uC2B5\uB2C8\uB2E4. \uC774\uB97C \uC704\uD574 \uC8FC\uB9D0\uACFC \uC5EC\uAC00 \uC2DC\uAC04\uC744 \uD65C\uC6A9\uD558\uC5EC \uB370\uC774\uD130 \uC911\uC2EC \uCEF4\uD3EC\uB10C\uD2B8 \uAE30\uBC18\uC758 \uB178\uCF54\uB4DC \uC5D4\uC9C4 \uAC1C\uBC1C\uC5D0 \uB9E4\uC9C4\uD588\uC2B5\uB2C8\uB2E4. \uC0AC\uC6A9\uC790\uAC00 \uCF54\uB529 \uC5C6\uC774\uB3C4 \uC6D0\uD558\uB294 \uACB0\uACFC\uBB3C\uC744 \uB9CC\uB4E4 \uC218 \uC788\uB3C4\uB85D \uC9C1\uAD00\uC801\uC778 \uC778\uD130\uD398\uC774\uC2A4\uC640 \uC720\uC5F0\uD55C \uCEF4\uD3EC\uB10C\uD2B8 \uC870\uD569 \uAE30\uB2A5\uC744 \uC81C\uACF5\uD558\uB294 \uAC83\uC744 \uBAA9\uD45C\uB85C \uD588\uC2B5\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
    \u0275\u0275elementStart(527, "p", 198);
    \u0275\u0275text(528, "\uCD5C\uADFC AI \uAE30\uC220\uC758 \uAE09\uACA9\uD55C \uBC1C\uC804\uC740 \uB178\uCF54\uB4DC \uD50C\uB7AB\uD3FC\uC758 \uAC00\uB2A5\uC131\uC744 \uB354\uC6B1 \uD655\uC7A5\uC2DC\uCF30\uC2B5\uB2C8\uB2E4. \uC774\uC5D0 \uB530\uB77C \uC800\uB294 \uB178\uCF54\uB4DC \uC5D4\uC9C4 \uAC1C\uBC1C\uC744 \uC7A0\uC2DC \uBCF4\uB958\uD558\uACE0, AI \uAE30\uC220 \uC5ED\uB7C9 \uAC15\uD654\uB97C \uC704\uD55C \uB2E4\uC591\uD55C \uD504\uB85C\uC81D\uD2B8\uC5D0 \uCC38\uC5EC\uD588\uC2B5\uB2C8\uB2E4. \uC55E\uC73C\uB85C\uB294 \uCD95\uC801\uB41C AI \uAE30\uC220 \uB178\uD558\uC6B0\uB97C \uB178\uCF54\uB4DC \uC5D4\uC9C4\uC5D0 \uC811\uBAA9\uD558\uC5EC \uC0AC\uC6A9\uC790\uC758 \uB370\uC774\uD130 \uBD84\uC11D \uBC0F \uD65C\uC6A9 \uB2A5\uB825\uC744 \uD5A5\uC0C1\uC2DC\uD0A4\uACE0, \uBCF4\uB2E4 \uC9C0\uB2A5\uC801\uC778 \uC790\uB3D9\uD654 \uAE30\uB2A5\uC744 \uC81C\uACF5\uD558\uB294 \uD601\uC2E0\uC801\uC778 \uD50C\uB7AB\uD3FC\uC744 \uAD6C\uCD95\uD560 \uACC4\uD68D\uC785\uB2C8\uB2E4.");
    \u0275\u0275elementEnd();
